import React from "react";
import Header from "./components/Header";
import "./styles/app.css";
import Hero from "./components/Hero";
import VideoPlaylist from "./components/VideoPlaylist";
import VideoDesc from "./components/VideoDescription";
import axios from "axios";

const apiKey = "319ec0b1-de93-49ba-9a24-0686f5de522d";

class App extends React.Component {
  state = {
    videoDescription: {},
    sideVideos: [],
  };

  getVideos() {
    axios
      .get(
        "https://project-2-api.herokuapp.com/videos?api_key=319ec0b1-de93-49ba-9a24-0686f5de522d"
      )
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log("There is an error");
      });
  }

  render() {
    return (
      <div className="App">
        <Header />
        <Hero />
        <div className="desc-comments">
          <VideoDesc
            desc={this.state.videoDescription}
            comments={this.state.videoDescription.comments}
          />
          <VideoPlaylist videos={this.state.sideVideos} />
        </div>
      </div>
    );
  }
}

export default App;
